let startNumber = 1;
let stopNumber = 10;
let pageData = { type: 'A4', width: 209.97, height: 297.01 };
let receiptTemplate = { src: 'receipt.png', width: 152.4, height: 72.81 };
let startPixel = { x: 28.8, y: 3.4 };
let startTextPixel = { x: 66.5, y: 31 };
let pageLoop = 4;

Number.prototype.pad = function(size) {
    var s = String(this);
    while (s.length < (size || 2)) { s = "0" + s; }
    return s;
}

function prepareReceipts() {

    // Acquire Variables
    fileTitle = document.getElementById("file-title").value;
    startNumber = document.getElementById("start-number").value;
    stopNumber = document.getElementById("stop-number").value;
    significantFigure = document.getElementById("significant-figure").value;


    if (fileTitle == "") {
        fileTitle = "Receipt.pdf";
    } else {
        fileTitle = fileTitle + "(" + startNumber + "-" + stopNumber + ").pdf";
    }

    saveToPDF(fileTitle, startNumber, stopNumber, significantFigure);
}

function saveToPDF(fileTitle, startNumber, stopNumber, significantFigure) {
    // Default export is a4 paper, portrait, using millimeters for units
    const doc = new jsPDF({
        unit: "mm",
        format: [pageData.width, pageData.height]
    });

    let currentDocumentPages = 1;
    let currentDocumentPageCount = 1;

    let totalRecipts = (stopNumber - startNumber) + 1;

    let pageCount = Math.ceil(totalRecipts / pageLoop);

    doc.setFont("calibri", "bold", "500");
    doc.setFontSize(10);

    imageOffsetY = startPixel.y;
    textOffsetY = startTextPixel.y;

    for (let currentPage = 1; currentPage <= pageCount; currentPage++) {
        let endN = currentPage * pageLoop;
        let startN = 1 + endN - pageLoop;
        if (pageCount == currentPage) {
            endN -= (totalRecipts % pageLoop);
        }

        for (let currentNumber = startN; currentNumber <= endN; currentNumber++) {
            let text = currentNumber.pad(significantFigure);
            // Place Image
            doc.addImage(receiptTEMP, 'png', startPixel.x, imageOffsetY, receiptTemplate.width, receiptTemplate.height);

            // Place Receipt Number
            doc.text(text, startTextPixel.x, textOffsetY);

            imageOffsetY += receiptTemplate.height;
            textOffsetY += receiptTemplate.height;
        }

        if (pageCount != currentPage) {
            doc.addPage();
            currentDocumentPageCount += 1;

            doc.setPage();
            currentDocumentPages += 1;

            imageOffsetY = startPixel.y;
            textOffsetY = startTextPixel.y;
        }
    }

    doc.save(fileTitle);
}

window.onload = function() {
    document.getElementById("prepare-receipt").removeAttribute('disabled');
}

let receiptTEMP = "data:image/png;base64,";